import React from 'react';

const Home = () => {
  return (
    <div style={{ width: '100%', height: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center', backgroundColor: '#1a1a2e' }}>
      <div
        style={{
          position: 'relative',
          width: '80%', // שליטה על רוחב
          height: '80%', // שליטה על גובה
          boxShadow: '0 2px 8px 0 rgba(63,69,81,0.16)',
          overflow: 'hidden',
          borderRadius: '8px',
          willChange: 'transform',
        }}
      >
        <iframe
          loading="lazy"
          style={{
            position: 'absolute',
            width: '100%',
            height: '100%',
            top: 0,
            left: 0,
            border: 'none',
            padding: 0,
            margin: 0,
          }}
          src="https://www.canva.com/design/DAGbOhdwBkQ/ooZcqrsHWTUhWM5-yEkriA/view?embed"
          allowFullScreen
          allow="fullscreen"
        ></iframe>
      </div>
    </div>
  );
};

export default Home;
